Ruger 10/22 wood stock 22LR rifle for sale.

Come with: 
2x 10rd rotary mags (1x black 1x transparent), 1x ruger 25 rd bx25 mag, 2x buttlercreek 25 rd mags; 
Weaver top rail for mounting scope;
3-9x40 hunting scope; 
cheek riser; 
stock extender.

All factory condition, only add on is the rubber stock extender (not shown on picture) which extend the length of pull to my comfort zone, and it can be removed easily.

Also have some 22LR Tracer ammo to go with it.

Trade Value for whole package is 390, only asking 290 cash.
